import styled from "styled-components";
import { useSelector } from "react-redux";

import { ComponentHeaderAuth } from "@components";
import { selectAuth, selectMerchant } from "@redux";
import { ModuleEmailResetPassword } from "@modules";
import { PageUserDetail } from "@pages";

export const PageResetPasswordEmail = () => {
    //redux state
    const merchant = useSelector(selectMerchant);
    const { detailUser } = useSelector(selectAuth);

    return (
        <>
            {!detailUser ? (
                <StyledContainer color={merchant.themeColor}>
                    <ComponentHeaderAuth />
                    <ModuleEmailResetPassword />
                </StyledContainer>
            ) : (
                <PageUserDetail />
            )}
        </>
    );
};

const StyledContainer = styled.div<{ color: string }>``;
